// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ImageStore {
    struct Image {
        string name;
        string ipfsHash;
    }

    mapping(uint256 => Image) public images;
    uint256 public imageCount = 0;

    event ImageUploaded(
        uint256 indexed imageId,
        string name,
        string ipfsHash,
        address uploader
    );

    function uploadImage(string memory _name, string memory _ipfsHash) public {
        require(bytes(_name).length > 0, "Name is required");
        require(bytes(_ipfsHash).length > 0, "IPFS hash is required");

        imageCount++;
        images[imageCount] = Image(_name, _ipfsHash);

        emit ImageUploaded(imageCount, _name, _ipfsHash, msg.sender);
    }
        function getImagePath(string memory _name) public view returns (string memory) {
        for (uint256 i = 1; i <= imageCount; i++) {
            if (keccak256(bytes(images[i].name)) == keccak256(bytes(_name))) {
                return images[i].ipfsHash;
            }
        }
        revert("Image not found");
    }
}
